import Link from 'next/link'

const CarLink = (props) => {
    return (
           <Link href="/cars/[car]" as={`/car/details`}>
            <a>{props.children}</a>
        </Link>
    )
}

const CarListLink = props => (
    <Link href="/cars/catalog/[catalog]" as={`/catalog/${props.name}/cars`}>
        <a>{props.children}</a>
    </Link>
)
export default {CarLink, CarListLink }
